}
.hover-overlay {
    position: absolute;
    top: 50%;
    left: 50%;
    transform: translate(-50%, -50%);
    width: 100%;
    height: 100%;

    text-align: center;
    display: flex;
    justify-content: center;
    align-items: center;

    background-color: #e7ecff;
    letter-spacing: .5px;

    -webkit-transition: .5s ease-in-out; 
    transition: .5s ease-in-out; 
    opacity: 0;
}
.overlay-text {
    color: rgb(1, 5, 51);
    font-weight: 800;
