.loader .inner {
	width: 100%;
	height: 100%;
	background: url(/c05fca94bc51fee2d0b79398f881bb11.gif) center center no-repeat;
}

sources.style.css:
body {
    margin: 0;
    padding: 0;
    font-family: 'Raleway', sans-serif;
    font-size: 14px;
    color: #6c7279;
    -webkit-font-smoothing: antialiased;

    background-color: rgb(252, 249, 249);
    overflow-x: hidden;
}

*,
*:before,
*:after {
    box-sizing: border-box;
}

h1, h2, h3, h4, h5, h6 {
    margin: 0;
}

p {
    margin: 0 0 10px;
}


.btn {
    outline: none;
    text-decoration: none;
    background-color: #FE7A1A;
    border: 1px solid #FE7A1A;
    padding: 10px 30px;
    color: black;
    text-align: center;
    font-weight: bold;
    font-size: 15px;
    margin-top: 30px;
    transition: all .3s linear;
}
.secondary-btn {
    border: 2px solid #FE7A1A;
    background-color: rgb(252, 249, 249);
    transition: all .3s linear;
    margin-left: 10px;
}
.btn:hover {
    background-color: rgb(250, 148, 74);
    transform: translateY(5px);
}

/* Header
===================*/
.header {
    width: 100%;
    height: 20vh;
    background-color: #31344e;
    z-index: 10000000000000000000000000000000000000;
    transition: .3s;
    display: flex;
    align-items: center;
    justify-content: space-between;
    padding: 30px 5%;
}
.sticky {
    position: sticky;
    top: 0%;
    left: 0%;
    width: 100%;
    height: 12vh;
}

/* Logo */
.sticky-ell {
    width: 40px;
    height: 40px;
}

.sticky-ell-txt{
    font-size: 21px;
}

.header__logo-name{
    display: flex;
    flex-direction: column;
    margin: 0 0 0 20px;

}
/*End of Logo */
/* Social */
.social {
    display: flex;
    justify-content: right;
    right: 0%;
}

.social__item {
    display: flex;
    align-items: center;
    width: 40px;
    height: 40px;
}

.social__icon {
    display: block;
    height: 18px;
    background-color: #31344e;
}
svg{
    fill: white;
}
svg:hover {
    fill: white;
    opacity: .8;
}
/* End of Social */

/* End of Header
===================*/
.header__logo {
    display: flex;
    align-items: center;
    text-decoration: none;
}
.header__logo-sign-ellipse {
    width: 50px;
    height: 50px;
    background: #FE7A1A;
    border-radius: 100px;
    display: flex;
    justify-content: center;
    align-items: center;
    transition: all .3s ease;
}
.header__logo-sign-text {
    position: absolute;
    font-weight: medium;
    font-size: 24px;
    color: white;
    transition: all .3s ease;
}
.it-1 {
    color: white;
    font-weight: 600;
    font-size: 18px;
    margin-bottom: 10px;
    transition: all .3s ease;
}
.sticky-it-1{
    font-size: 16px;
}
.it-2{
    color: rgba(255, 255, 255, 0.877);
    font-weight: 500;
    font-size: 14px;
    transition: all .3s ease;
}
.sticky-it-2{
    font-size: 12px;
}
.title {
    width: 80%;
    margin: 0 auto;
    text-align: center;
}
.heading {
    color: black;
    font-size: 36px;
    letter-spacing: .2;
    font-weight: 600;
}
.subtitle {
    color: rgb(94, 94, 94);
    text-align: center;
    margin-top: 20px;
    font-size: 20px;
    font-weight: 500;
}
#action{
    position: fixed;
    bottom: 30px;
    right: 15px;
    width: 50px;
    height: 50px;
    background: orangered;
    border-radius: 50%;
    box-shadow: 0 5px 5px rgba(0,0,0, .1);
    cursor: pointer;
    z-index: 10000;
    text-decoration: none;
}
#action span{
    position: relative;
    width: 100%;
    height: 100%;
    display: flex;
    justify-content: center;
    align-items: center;
    color: white;
    font-size: 2em;
    transition: .3s ease-in-out;
    opacity: 1;
}



/* Navigation */
.nav {
    display: flex;
    text-transform: uppercase;
}

.nav__link {
    margin-left: 20px;
    padding: 1rem;
    color: #fff;
    text-decoration: none;
    font-weight: 500;
    font-size: 14px;
    color: rgba(255, 255, 255, 0.877);
}

.nav__link:first-child {
    margin-left: 0px;
}
.nav__link:last-child {
    margin-right: 30px;
}
.nav .current{
    color: #FF9243;
}
/* End of Navigation */

/* Intro
===================*/

.intro {
    height: 100vh;
    width: 100%;
    background: linear-gradient( rgba(0, 0, 0, 0.3), rgba(0, 0, 0, 0.2) ), url(./assets/images/banner.jpg) no-repeat center;      
    background-size: cover;
    background-attachment: fixed;
}
.intro__inner {
    display: flex;
    flex-direction: column;
    justify-content: center;
    align-items: center;
    height: 90vh;
}
.main-btn {
    width: 20%;
    box-shadow:0px 0px 30px rgb(100, 44, 1);
    border-top-left-radius: 50px;
    border-bottom-right-radius: 50px;
}
.intro__inner:hover .main-btn {
    animation: buttonRotation 2s 1s linear;
}

@keyframes buttonRotation {
    0% {transform: scale(1) rotateZ(0)}
    5% {transform: scale(1.1) rotateZ(5deg)}
    10% {transform: scale(1.05) rotateZ(-5deg)}
    15% {transform: scale(1.05) rotateZ(5deg)}
    20% {transform: scale(1.05) rotateZ(-5deg)}
    25% {transform: scale(1.05) rotateZ(5deg)}
    30% {transform: scale(1.05) rotateZ(-5deg)}
    35% {transform: scale(1.05) rotateZ(5deg)}
    40% {transform: scale(1.05) rotateZ(-5deg)}
    45% {transform: scale(1.05) rotateZ(5deg)}
    50% {transform: scale(1.05) rotateZ(-5deg)}
    55% {transform: scale(1.05) rotateZ(5deg)}
    60% {transform: scale(1.05) rotateZ(-5deg)}
    65% {transform: scale(1.05) rotateZ(5deg)}
    70% {transform: scale(1.05) rotateZ(-5deg)}
    75% {transform: scale(1.05) rotateZ(5deg)}
    80% {transform: scale(1.05) rotateZ(-5deg)}
    85% {transform: scale(1.05) rotateZ(5deg)}
    90% {transform: scale(1.05) rotateZ(-5deg)}
    95% {transform: scale(1.05) rotateZ(5deg)}
    100% {transform: scale(1) rotateZ(0)}
}

.intro__title {
    color: white;
    font-size: 55px;
    text-align: center;
    letter-spacing: 2px;
}
.intro__subtitle {
    color: rgb(201, 221, 250);
    text-align: center;
    margin-top: 20px;
    font-size: 20px;
}
/* End of Intro
===================*/

/* About
===================*/
.about {
    width: 100%;
    height: 90vh;

}
.about-container {
    height: 100%;
    position: relative;
    background-color: rgb(252, 249, 249);
    padding-bottom: 300px;
}
/* Main section */
.about-inner {
    display: flex;
    position: absolute;
    top: 25%;
    left: 50%;
    transform: translate(-50%, -50%);
    width: 75%;
    height: 80vh;
    text-align: left;
    padding: 55px;
    background-color: white;
    box-shadow:0px 0px 30px rgb(201, 201, 201);
}
.about-text {
    width: 50%;
    padding-left: 50px;
}
.img-box {
    width: 40%;

}
.about-img {
    max-width: 100%;
    height: auto;
}

.about-greetings {
    background: -webkit-gradient(linear, left top, right top, from(#38d39f), to(#38a4d3));
    background: linear-gradient(left, #38d39f, #38a4d3);
    background-clip: text;
    -webkit-background-clip: text;
    -webkit-text-fill-color: transparent;
    font-size: 40px;
    letter-spacing: .2;
    font-weight: 600;
}
.about-par {
    padding-top: 20px;
    padding-bottom: 20px;
    font-size: 18px;
    font-weight: 400;
}
.about-svg-anim {
    width: 400px;
    position: absolute;
    background-color: transparent;
    top: 63%;
    left: 63%;
}
/* ABOUT SVG ANIMATION */
#first-sqr {
    animation: f-sqr-rotation 5s infinite linear;
    transform-origin: center;
    transform-box: fill-box;
}

@keyframes f-sqr-rotation {
    from {
        transform: rotate(0deg);
    }
    to{
        transform: rotate(1800deg);
    }
}

#second-sqr {
    animation: s-sqr-rotation 4s infinite linear;
    transform-origin: center;
    transform-box: fill-box;
}

@keyframes s-sqr-rotation {
    from {
        transform: rotate(0deg);
    }
    to{
        transform: rotate(-1800deg);
    }
}
#third-sqr {
    animation: t-sqr-rotation 2s infinite ease-out;
    transform-origin: center;
    transform-box: fill-box; 
}

@keyframes t-sqr-rotation {
    from {
        transform: rotate(0deg);
    }
    to{
        transform: rotate(360deg);
    }
}
#or-sqr {
    animation: or-sqr 1s infinite linear;
}
@keyframes or-sqr {
    0%{
        transform: translate(0px,0px);
    }
    33%{
        transform: translate(5px,10px);;
    }
    66%{
        transform: translate(-5px,-10px);
    }
    100%{
        transform: translate(0px,0px);
    }

}
#arm-svg {
    animation: arm-anim 4s infinite ease;
    transform-origin: bottom;
    transform-box: fill-box;
}
@keyframes arm-anim {
    0%{
        transform: rotateZ(0deg);
    }
    33%{
        transform: rotateZ(15deg);
    }
    66%{
        transform: rotateZ(-15deg);
    }
    100%{
        transform: rotateZ(0deg);
    }
}
#head-svg {
    animation: arm-anim 4s infinite ease-in-out;
    transform-origin: bottom;
    transform-box: fill-box;
}
@keyframes arm-anim {
    0%{
        transform: rotateZ(0deg);
    }
    33%{
        transform: rotateZ(10deg);
    }
    66%{
        transform: rotateZ(-15deg);
    }
    100%{
        transform: rotateZ(0deg);
    }
}
#backgr-1 {
    animation: background 3s infinite ease-in-out;
}
@keyframes background {
    0%{
        transform: translateX(0px);
    }
    50%{
        transform: translateX(50px);
    }
    100%{
        transform: translateX(0px);
    }
}
#text-l1 {
    animation: text 3s infinite linear;
}

#text-l2 {
    animation: text 4s infinite ease;
}
#text-l3 {
    animation: text 5s infinite ease-in-out;
}

#text-l4 {
    animation: text 3s infinite ease-in;
}

#text-l5 {
    animation: text 2s infinite ease-out;
}
@keyframes text{
    0%{
        transform: translateX(0px);
    }
    50%{
        transform: translateX(-50px);
        width: 30%;
    }
    100%{
        transform: translateX(0px);
    }
}
#circle {
    animation: circle 6s infinite linear;
}
